                    <IonIcon icon={home} slot="start"></IonIcon>
                    <IonLabel>Home</IonLabel>
                  </IonItem>
                  <IonItem>
                    <IonIcon icon={person} slot="start"></IonIcon>
                    <IonLabel>Profile</IonLabel>
                  </IonItem>
                  <IonItem>
                    <IonIcon icon={chatbubbles} slot="start"></IonIcon>
                    <IonLabel>Messages</IonLabel>
